import React, {Component} from 'react';
import '../../css/index.css'
import NavigationItem from "../../components/Navigation/NavigationItem";

class Header extends Component {
    render (){
        return (
            <div className='header'>
                <div className='logo'>
                    <img src='../../image_folder/Desktop/logos/logo.png' />
                </div>
                <div className='navLinks'>
                    <ul>
                        <li><NavigationItem link="/" exact>HOME</NavigationItem></li>
                        <li><NavigationItem link="/" exact>ABOUT US</NavigationItem></li>
                        <li><NavigationItem link="/" exact>OUR SERVICES</NavigationItem></li>
                        <li><NavigationItem link="/" exact>PROPERTIES</NavigationItem></li>
                        <li><button>CONTACT US</button></li>
                    </ul>
                </div>
            </div>
        );
    }
}

export default Header;
